import React from 'react';

// material-ui
import { Button, Card, Grid, TextField, Dialog, Divider, DialogActions, DialogContent, DialogTitle, Typography, Autocomplete } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';


import PermContactCalendarIcon from '@material-ui/icons/PermContactCalendar';

// Extensions
import FormControl from 'ui-component/extended/Form/FormControl';
import LockTwoToneIcon from '@material-ui/icons/LockTwoTone';
// ===============================|| UI DIALOG - SWEET ALERT ||=============================== //

export default function AlertDialog({user}) {
    const [open, setOpen] = React.useState(false);
    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    // Rank list
    const ranks =
    [
    { title: 'N/A'},
    { title: 'Civilian'},
    { title: 'Airman Basic'},	
    { title: 'Basic Airman'},
    { title: 'Airman'},
    { title: 'Airman First Class'},
    { title: 'Senior Airman'},
    { title: 'Staff Sergeant'},
    { title: 'Technical Sergeant'},	
    { title: 'Master Sergeant'},
    { title: 'Senior Master Sergeant'},
    { title: 'Chief Master Sergeant'},
    { title: 'Command Chief Master Sergeant'},
    { title: 'Second lieutenant'},
    { title: 'First lieutenant'},
    { title: 'Captain'},
    { title: 'Major'},
    { title: 'Lieutenant colonel'},
    { title: 'Colonel'},
    { title: 'Brigadier general'},
    { title: 'Major general'},
    { title: 'Lieutenant general'},
    { title: 'General'}
    ]

    // Sections list
    const sections =
    [
    { title: '341 FSS'},
    { title: '90 CS'},
    { title: 'Jordans Flight'}
    ]

    // Permissions list
    const permissions =
    [
    { title: 'Looser'},
    { title: 'Almost not a looser'},
    { title: 'Not a looser'},
    { title: 'Ultimate'},
    { title: 'Im FUCKING GOD'}
    ]


    const useStyles = makeStyles((theme) => ({
        successBadge: {
            color: theme.palette.success.dark,
            width: '14px',
            height: '14px'
        },
        tableAvatar: {
            width: '60px',
            height: '60px'
        },
        btnTable: {
            borderRadius: '4px',
            paddingLeft: '4px',
            paddingRight: '4px',
            width: '100%',
            minWidth: '120px',
            '&:hover': {
                background: theme.palette.secondary.main,
                borderColor: theme.palette.secondary.main,
                color: '#fff'
            }
        },
        tableResponsive: {
            overflowX: 'auto'
        },
        profileTable: {
            '& td': {
                whiteSpace: 'nowrap'
            },
            '& td:first-child': {
                paddingLeft: '0px'
            },
            '& td:last-child': {
                paddingRight: '0px',
                minWidth: '260px'
            },
            '& tbody tr:last-child  td': {
                borderBottom: 'none'
            },
            [theme.breakpoints.down('lg')]: {
                '& tr:not(:last-child)': {
                    borderBottom: '1px solid',
                    borderBottomColor: theme.palette.mode === 'dark' ? 'rgb(132, 146, 196, .2)' : 'rgba(224, 224, 224, 1)'
                },
                '& td': {
                    display: 'inline-block',
                    borderBottom: 'none',
                    paddingLeft: '0px'
                },
                '& td:first-child': {
                    display: 'block'
                }
            }
        },
        tableSubContent: {
            whiteSpace: 'break-spaces'
        }
    }));

    return (
        <>
            {/* <PermContactCalendarIcon onClick={handleClickOpen} sx={{ fontSize: '1.1rem' }} />
             */}
            <Grid onClick={handleClickOpen} item xs={12}>



            <Grid container spacing={2}>
                                    <Grid item sm zeroMinWidth>
                                        <Grid container spacing={1}>
                                            <Grid item xs={12}>
                                                <Typography align="left" variant="subtitle1">
                                                   132123132123
                                                </Typography>
                                                <Typography align="left" variant="subtitle2" className={classes.tableSubContent}>
                                                    123123132
                                                </Typography>
                                            </Grid>
                                            <Grid item xs={12}>
                                                <Typography align="left" variant="body2" className={classes.tableSubContent}>
                                                    31312123
                                                </Typography>
                                            </Grid>
                                        </Grid>
                                    </Grid>
                                </Grid>
            <Grid container spacing={2}>
                                    <Grid item xs={12}>
                                        <Typography variant="caption">Email</Typography>
                                        <Typography variant="h6">123213</Typography>
                                    </Grid>
                                    <Grid item xs={12}>
                                        <Typography variant="caption">Phone</Typography>
                                        <Typography variant="h6">123123132</Typography>
                                    </Grid>
                                </Grid>




                    <Grid container spacing={2} alignItems="center">
                        <Grid item xs zeroMinWidth>
                            <Typography align="left" component="div" variant="subtitle1">
                        {`${user.rank} ${user.first_name} ${user.last_name}`}
                        </Typography>
                        <Typography align="left" component="div" variant="subtitle2">
                            {`${user.job_title}`}
                        </Typography>
                    </Grid>
                    <Grid item>
                        <Typography align="left" variant="caption">
                        {`${user.cell_phone}`}
                        </Typography>
                    </Grid>
                    </Grid>
            </Grid> 


            <Dialog
                open={open}
                onClose={handleClose}
                aria-labelledby="alert-dialog-title"
                aria-describedby="alert-dialog-description"
                sx={{ p: 3 }}
            >
                <DialogTitle id="alert-dialog-title">{`Details for ${user.rank} ${user.first_name} ${user.last_name}`}</DialogTitle>
                <DialogContent>
                    <Card><Divider/><br/></Card>
                  <Grid container spacing={2} columns={16}>
                      <Grid item xs={8}>
                            <TextField fullWidth 
                                id="outlined-basic" 
                                label="First Name"
                                value={user.first_name}
                                disabled
                            />
                        </Grid>
                        <Grid item xs={8}>
                            <TextField fullWidth 
                                id="outlined-basic" 
                                label="Last Name"
                                value={user.last_name}
                                disabled
                            />
                         </Grid>
                         <Grid item xs={8}>
                         <TextField fullWidth 
                                id="outlined-basic" 
                                label="Rank"
                                value={user.rank}
                                disabled
                            />
                        </Grid>
